webpackJsonp([0xb9a179257dbb],{4217:function(t,a){t.exports={data:{markdownRemark:{html:"<p>自作楽曲一覧です。東方アレンジに手を出し始めたのは2004年からなので、東方をお探しの方は該当する年代のメニューへどうぞ。(それ以前はオリジナル曲や主にDDR・BM関係のアレンジの類です)</p>\n<h2>推奨環境・注意など</h2>\n<ul>\n<li>基本的に音楽フォーマットはMP3及びWMA(試聴のみ)ですが、一部曲にはMIDIやBMSも混じっています。</li>\n<li>MIDI楽曲は“XG”の曲はYAMAHA MU50以降、“GS”の曲はRoland SC-88Pro以降で聞くと幸せになれます、多分。</li>\n<li>BMS楽曲は再生に7ラインBME対応プレイヤーが必要です。</li>\n</ul>",frontmatter:{cover:null,date:"2007-12-31T00:00:00+09:00",strDate:"2007/12/30",title:"自作楽曲のページについて"}}},pathContext:{path:"/ja/blog/2007/12/31-自作楽曲のページについて/",langKey:"ja"}}}});
